    false,nt"url": null,nt"notes": "This annual narrative report for Kirwin
    National Wildlife Refuge summarizes refuge activities during the 1992 calendar year.
     The report begins with a summary of the yearu2019s highlights and climatic conditions.
    Land acquisition including fee title and wildlife extension agreements is also covered.
    The report includes a planning section which discusses master plans, management
    plans, and research and investigations.  Refuge administration is outlined; information
    about personnel, volunteer programs, other manpower programs, funding, safety, and
    other is given.  Habitat management is also covered.  Subjects include general,
    wetlands, forests, croplands, grasslands, other habitats, grazing, haying, fire
    management, pest control, water rights, and wilderness and special areas.  The wildlife
    section of the report discusses wildlife diversity, endangered and/or threatened
    species, waterfowl, marsh and water birds, shorebirds, gulls, terns and allied species,
    raptors, other migratory birds, game mammals, other resident wildlife, fisheries
    resources, scientific collections, and disease prevention and control.  The public
    uses of the refuge described in this report include general, interpretive foot trails,
    interpretive tour routes, other interpretive programs, hunting, fishing, wildlife
    observation, other wildlife oriented recreation, camping, off-road vehicling, and
    law enforcement.  The equipment and facilities section of the report provides information
    about rehabilitation, major maintenance, equipment utilization and replacement,
    communications systems, and energy conservation.  Items of interest are provided
    at the end.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
